import React from 'react';
import balysh from '../../img/balysh.svg'

const Component5 = () => {
   return (
      <div>
         <div class="carrer">
            <div class="balysh">
                <img src={balysh} alt=""/>
            </div>
            <div class="text4">
                <p class="car">carrer</p>
                <p class="collab">Collaboratively administrate turnkey channels whereas virtual e-tailers.</p>
                <p class="object">Objectively seize scalable metrics whereas proactive e-services seamlessly empower fully researched growth strategies.</p>
                <p class="inter">And interoperable internal or “organic” sources.</p>
                <button class="radius">Learn More</button>
            </div>
        </div>
      </div>
   );
};

export default Component5;
